description:
-Country: USA;
-Year: 2012;
-Runtime: 136 minutes;

-Summary: Peter Parker finds a clue that might help him understand why his parents disappeared when he was young. His path puts him on a collision course with Dr. Curt Connors, his father's former partner.

-Director: Marc Webb;
-Writers: James Vanderbilt &amp; Alvin Sargent;
-Stars: Irrfan Khan, Emma Stone, Andrew Garfield, Denis Leary, , Rhys Ifans, Martin Sheen, Sally Field, Campbell Scott, Embeth Davidtz
